    function getUserId() {
      const cookiePrefix = "TokenData=";
      const cookies = document.cookie.split(";");
  
      for (let i = 0; i < cookies.length; i++) {
        let cookie = cookies[i].trim();
        if (cookie.indexOf(cookiePrefix) === 0) {
          const cookieValue = cookie.substring(cookiePrefix.length);
          try {
            const parsedData = JSON.parse(decodeURIComponent(cookieValue));
            return parsedData.UserId || null;
          } catch (error) {
            GM_deleteValue("authToken");
            GM_deleteValue("keyType");
            GM_deleteValue("currentKey");
            return null;
          }
        }
      }
  
      GM_deleteValue("authToken");
      GM_deleteValue("keyType");
      GM_deleteValue("currentKey");
      return null;
    }
  
    function formatTimeRemaining(seconds) {
      if (seconds <= 0) return "Expired";
      const days = Math.floor(seconds / (3600 * 24));
      const hours = Math.floor((seconds % (3600 * 24)) / 3600);
      const minutes = Math.floor((seconds % 3600) / 60);
      const secs = Math.floor(seconds % 60);
      return `${days}d ${hours}h ${minutes}m ${secs}s`;
    }
  
