      keyInputField.style.borderRadius = "6px";
      keyInputField.style.color = "#ffffff";
      keyInputField.style.fontSize = "14px";
      keyInputField.style.boxSizing = "border-box";
  
      const submitButton = document.createElement("button");
      submitButton.style.width = "100%";
